import React from "react";
import { useNavigate } from "react-router-dom";

const HomeScreen = () => {
  const navigate = useNavigate();

  return (
    <div style={{ textAlign: "center", padding: "20px", backgroundColor: "#eef5d7" }}>
      <h1>
        DEPARTMENT OF INFORMATION TECHNOLOGY <br />
        NATIONAL INSTITUTE OF TECHNOLOGY KARNATAKA, SURATHKAL-575025
      </h1>

      <h2>
        Information Assurance and Security (IT352) Course Project <br />
        Title: “DEPHIDES: Deep Learning Based Phishing Detection System”
      </h2>

      <h2>
        Carried out by <br />
        Nidhi Kumari (221IT047) <br />
        Sneha Singh (221IT063) <br />
        During Academic Session January – April 2025
      </h2>

      <button className="button" onClick={() => navigate("/input")}>
        Press here to Enter Input
      </button>
      <button className="button" onClick={() => navigate("/output")}>
        Press here to display output on Screen
      </button>
      <button className="button" onClick={() => console.log("Store output logic")}>
        Press here to store the output
      </button>
    </div>
  );
};

export default HomeScreen;
